import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import ReactDOM from "react-dom";
import Signup from "./components/Signup";
import Signin from "./components/Signin";
import Header from "./components/Header";
import Home from "./components/Home";
import Showquiz from "./components/Showquiz";
import Quizset from "./components/Quizset";
import Createquiz from "./components/Createquiz";
import Showmarks from "./components/Showmarks";
import LoggedHeader from "./components/LoggedHeader";
import Profile from "./components/Profile";
import Notfound from "./components/Notfound";

export default class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      islogged: false
    };
  }

  handleIslogged = value => {
    this.setState({ islogged: value });
  };

  render() {
    return (
      <div className="whole-app">
        <Router>
          {localStorage.quizuserToken ? (
            <LoggedHeader />
          ) : (
            <Header handleIslogged={this.handleIslogged} />
          )}
          <Switch>
            <Route path="/" exact exact component={Home} />
            <Route
              exact
              handleIslogged={this.handleIslogged}
              path="/signup"
              component={Signup}
            />
            <Route exact path="/signin">
              <Signin handleIslogged={this.handleIslogged} />
            </Route>
            <Route
              handleIslogged={this.handleIslogged}
              path="/admin/login"
              component={Signin}
              exact
            />
            <Route path="/quizsets" exact component={Quizset} />
            <Route path="/myprofile" exact component={Profile} />
            <Route path="/createquiz" exact component={Createquiz} />
            <Route path="/quizsets/:quizname" exact component={Showquiz} />
            <Route path="/*" exact component={Notfound} />
          </Switch>
        </Router>
      </div>
    );
  }
}
ReactDOM.render(<Index />, document.getElementById("root"));
